async function cPost(t){let e=await fetch(t,{method:"POST",body:JSON.stringify({id:3})});if(e.ok){let t=await e.json();document.write(t)}}async function fPost(t){let e=new FormData;e.append("id",1);let o=await fetch(t,{method:"POST",body:e});if(o.ok){let t=await o.json();document.write(t)}}async function jPost(t){let e=await $.post(t,{id:2}).then(),o=JSON.parse(e);document.write(o)}let url="/assets/php/test.inc.php";fPost(url),jPost(url),cPost(url);